import React from 'react';
import Navigation from './Navigation';

const Layout = ({children})=>{
    return(
        <>
            <div>
                <Navigation />
                <div>
                    {children}
                </div>
            </div>

            <style jsx>{`
            div{
                background: #BF2642;
                width: calc(100% + 1em);
                height: auto;
                margin: -1em;
            }
        `}</style>
        </>
    )
}
export default Layout;
